class Menu extends Component {
    render() {
        return (
            <div>
               

                <div class="container">
                    <div class="row">
                        <div class="col-sm-11"> <h3> ¿Qué se te antoja comer hoy? </h3></div>
                        <div class="col-sm-1">  <Link className="btn btn-primary mt-1 " to="/" role="button">Regresar</Link> </div>
                    </div>
                </div>
            </div>
        )
    }
}

export default Menu;
